import React from "react";
import { NavLink } from "react-router-dom";
const NavBar=()=>{
    return( 
    <>
    <NavLink activeClass to="/">About Us</NavLink>
    <NavLink activeClass to="/contact">Contact Us</NavLink>
    <NavLink activeClass to="pikachu">Pikachu</NavLink>
    {/* <Link>pikachu</Link> */}
    {/* <a href="/">About Us</a>
    <a href="/contact">Contact Us</a>
    <a href="/pikachu">Pikachu</a> */}
    </>);
}
export default NavBar;
